import React from "react";

function ItemListContainer() {
  const add = (cantidad) => {
    alert("Agregaste " + cantidad + " producto(s) al carrito.");
  };
  return (
    <>
      <p>Hola, soy el container :D </p>
    </>
  );
}

export default ItemListContainer;
